import { Card, Avatar } from 'antd';


const UserProfile = () => {
    return (
        <Card>
            <Card.Meta 
                avatar={<Avatar>ZC</Avatar>}
                title="ZeroCho"
            />
        </Card>
    )
}

export default UserProfile;
